import logo from '../../assets/img/Imagen3.png'
import {Link} from 'react-router-dom'

class Index extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    
    render() { 
        return ( 
            <>
            <div className="container m-0">
                <div className="row">
                    <div className="col menu">
                        <img src={logo} alt="" width="100%"/>
                        <nav className="navbar row text-center">
                            <Link className="nav-link fs-4 text-black" to="">Dashboard</Link>
                            <Link className="nav-link fs-4 text-black" to="">Crear consecutivo</Link>
                            <Link className="nav-link fs-4 text-black" to="">Cerrar sesi√≥n</Link>
                        </nav>
                    </div>
                    <div className="col">
                        <h1>Usuario</h1>
                    </div>
                    </div>
                
            </div>
            </>
        );
    }
}
export default Index;
